import React from 'react';
import './RegisterPage.css';

function RegisterPage() {
  return (
    <div className="register-container">
      <img className='register-girlSearching' src="./Images/girl-searching.svg" alt="Imagem" />

      <div className='register-containerWithFields'>
        <h1>Criar uma conta</h1>
        <h2 class="register-split-title">
          <span class="register-metade-esquerda">Já é usuário?</span>
          <span class="register-metade-direita">Criar uma conta</span>
        </h2>
        <input type="text" class="register-email-textField" placeholder="Email:"></input>
        <input type="password" class="register-password-textField" placeholder="Senha:"></input>
        <div className='register-containerWithButtons'>
          <button className='register-forgotMyPassword'>Esqueci minha senha</button>
          <button className='register-enter'>ENTRAR</button>
        </div>

      </div>
    </div>
  );
}

export default RegisterPage;
